DROP TABLE IF EXISTS `CLIENT_SCOPE_ROLE_MAPPING`;
CREATE TABLE `CLIENT_SCOPE_ROLE_MAPPING` (
  `SCOPE_ID` varchar(36) NOT NULL,
  `ROLE_ID` varchar(36) NOT NULL
