DROP TABLE IF EXISTS `FED_USER_ROLE_MAPPING`;
CREATE TABLE `FED_USER_ROLE_MAPPING` (
  `ROLE_ID` varchar(36) NOT NULL,
  `USER_ID` varchar(255) NOT NULL,
